const priorAGI = $json["prior_year_AGI"];
const priorTax = $json["prior_year_tax"];

let safeHarborTax;

if (priorAGI <= 150000) {
  safeHarborTax = priorTax * 1.00;
} else {
  safeHarborTax = priorTax * 1.10;
}

return [
  {
    json: {
      prior_year_AGI: priorAGI,
      prior_year_tax: priorTax,
      safe_harbor_tax: safeHarborTax
    }
  }
];

const safeHarborTax = $json["safe_harbor_tax"];

const quarterlyTax = safeHarborTax / 4;

return [
  {
    json: {
      safe_harbor_tax: safeHarborTax,
      quarterly_tax_payment: parseFloat(quarterlyTax.toFixed(2))  // Rounded to 2 decimals
    }
  }
];

const quarterlyTax = $json["quarterly_tax_payment"]; // From Step 3
const seIncome = $json["se_income"];
const withholdings = $json["annual_withholdings"];

// Step 4: Calculate Self-Employment Tax
let seTaxAnnual = 0;
let seTaxQuarterly = 0;

if (seIncome > 0) {
  seTaxAnnual = seIncome * 0.9235 * 0.153;
  seTaxQuarterly = seTaxAnnual / 4;
}

// Step 5: Subtract Withholdings
const withholdingQuarterly = withholdings / 4;

// Final quarterly payment
const finalQuarterlyPayment = quarterlyTax + seTaxQuarterly - withholdingQuarterly;

return [
  {
    json: {
      quarterly_base_tax: quarterlyTax,
      se_income: seIncome,
      se_tax_annual: parseFloat(seTaxAnnual.toFixed(2)),
      se_tax_quarterly: parseFloat(seTaxQuarterly.toFixed(2)),
      annual_withholdings: withholdings,
      quarterly_withholdings: parseFloat(withholdingQuarterly.toFixed(2)),
      final_quarterly_payment_due: parseFloat(finalQuarterlyPayment.toFixed(2))
    }
  }
];

const totalTaxLiability = $json["total_tax_liability"];     // total annual estimated tax
const annualWithholdings = $json["annual_withholdings"];
const finalQuarterlyDue = $json["final_quarterly_payment_due"];

// Threshold checks
const underMinimum = totalTaxLiability < 1000;
const coveredByWithholding = annualWithholdings >= (0.9 * totalTaxLiability);

// Result
let adjustedQuarterlyDue = finalQuarterlyDue;
let message = "Quarterly estimated payment required.";

if (underMinimum || coveredByWithholding) {
  adjustedQuarterlyDue = 0;
  message = underMinimum
    ? "No estimated payments required (total tax liability under $1,000)."
    : "Withholdings cover 90%+ of liability. No estimated payments required.";
}

return [
  {
    json: {
      total_tax_liability: totalTaxLiability,
      annual_withholdings: annualWithholdings,
      final_quarterly_payment_due: finalQuarterlyDue,
      adjusted_quarterly_due: parseFloat(adjustedQuarterlyDue.toFixed(2)),
      reason: message
    }
  }
];

let dateStr = $input.first().json.currentDate; // e.g. "2025-07-25T00:00:00.000+02:00"
let date = new Date(dateStr);

// Normalize to only the date (no time)
let current = new Date(date.getFullYear(), date.getMonth(), date.getDate());

// IRS Quarterly Due Dates
let year = date.getFullYear();
let dueDates = [
  new Date(year, 0, 15),   // Jan 15 (Q4 of previous year or Q1)
  new Date(year, 3, 15),   // Apr 15 (Q1)
  new Date(year, 5, 15),   // Jun 15 (Q2)
  new Date(year, 8, 15),   // Sep 15 (Q3)
  new Date(year + 1, 0, 15) // Jan 15 next year (Q4)
];

// Check if within 7-day window of any due date
const within7Days = dueDates.some(due => {
  const diff = Math.abs((current - due) / (1000 * 60 * 60 * 24));
  return diff <= 7;
});

return [
  {
    json: {
      current_date: current.toISOString().split("T")[0],
      reminder_triggered: within7Days
    }
  }
];

let dateStr = $input.first().json.currentDate; // e.g. "2025-07-25T00:00:00.000+02:00"
let date = new Date(dateStr);

// Normalize to only the date (no time)
let current = new Date(date.getFullYear(), date.getMonth(), date.getDate());

// Define July 1st of current year
let july1 = new Date(date.getFullYear(), 6, 1); // month is 0-indexed, so 6 = July

// Check if today is July 1
const isJulyFirst = current.getTime() === july1.getTime();

return [
  {
    json: {
      current_date: current.toISOString().split("T")[0],
      is_july_first: isJulyFirst
    }
  }
];
